'''基于希尔伯特曲线遍历的空间子注意力模块'''
class Hilbert_Sa(nn.Module):
    '''order为该模块所采用的哪一阶希尔伯特曲线'''
    def __init__(self,order,pool_size):
        super(Hilbert_Sa, self).__init__()

        self.softmax = nn.Softmax(2)
        self.sigmiod = nn.Sigmoid()
        self.order = order
        self.pool_size = pool_size
        self.rh = int((2**self.order)/self.pool_size)
        self.path_num = int(((2**self.order)/self.pool_size)**2)
        self.channel = self.pool_size**2
        self.trans_q = nn.Conv2d(self.channel,1,1)
        self.trans_k = nn.Conv2d(self.channel,1,1)
        self.trans_v = nn.Conv2d(self.channel,1,1)
        self.rehil = rehil
        if pool_size == 1:
            self.hil = hil_16
        elif pool_size==2:
            self.hil = hil_32
        elif pool_size==4:
            self.hil = hil_64
        else:
            self.hil = hil_128
        self.up = nn.UpsamplingNearest2d(size=(2**self.order,2**self.order))

    def forward(self,x):
        r = x
        b,c,h,w = x.shape
        mean = torch.mean(x,dim=1,keepdim=True)
        max,_ = torch.max(x,dim=1,keepdim=True)
        mean_x1 = mean.view(b,1,1,-1) #B*1*1*HW
        max_x1 = max.view(b,1,1,-1) #B*1*1*HW
        mean_d = torch.chunk(mean_x1,h*w,3)
        max_d = torch.chunk(max_x1,h*w,3)
        ########希尔伯特曲线遍历过程###############
        mean_l = []
        max_l = []
        for i in range((2**self.order)*(2**self.order)):
            num = self.hil[i]
            mean_l.append(mean_d[num])
            max_l.append(max_d[num])
        mean_x2 = torch.cat(mean_l,3) #B*1*1*HW
        max_x2 = torch.cat(max_l,3) #B*1*1*HW
        mean_m = torch.chunk(mean_x2,self.path_num,3)#B*1*1*ps^2
        max_m = torch.chunk(max_x2,self.path_num,3)#B*1*1*ps^2
        mean_x2 = torch.cat(mean_m,dim=2).permute(0,3,1,2).contiguous()   #B*ps^2*1*p_n
        max_x2 = torch.cat(max_m,dim=2).permute(0,3,1,2).contiguous()   #B*ps^2*1*p_n

        ########################二维卷积生成QKV############################
        mean_Q = self.trans_q(mean_x2)  # B*c*1*p_n
        mean_Q = torch.squeeze(mean_Q, 2).permute(0, 2, 1).contiguous()  # B,p_n,1
        max_Q = self.trans_q(max_x2)  # B*c*1*p_n
        max_Q = torch.squeeze(max_Q, 2).permute(0, 2, 1).contiguous()  # B,p_n,1
        mean_K = self.trans_k(mean_x2)
        mean_K = torch.squeeze(mean_K, 2)
        max_K = self.trans_k(max_x2)
        max_K = torch.squeeze(max_K, 2)
        mean_V = self.trans_v(mean_x2)
        mean_V = torch.squeeze(mean_V, 2).permute(0, 2, 1).contiguous()
        max_V = self.trans_v(max_x2)
        max_V = torch.squeeze(max_V, 2).permute(0, 2, 1).contiguous()
        #########################自注意力机制的计算#######################
        mean_w = self.softmax(torch.matmul(mean_Q,mean_K)) #B*p_n*p_n
        max_w = self.softmax(torch.matmul(max_Q,max_K)) #B*p_n*p_n
        mean_x3 = torch.matmul(mean_w,mean_V).unsqueeze(2)    #B*p_n*1*1
        max_x3 = torch.matmul(max_w,max_V).unsqueeze(2)    #B*p_n*1*1
        # print(max_x3.shape)
        mean_d = torch.chunk(mean_x3,self.path_num,dim=1)
        max_d = torch.chunk(max_x3,self.path_num,dim=1)
        ############################反希尔伯特曲线返回原像素点位置#################
        mean_l1 = []
        max_l1 = []
        # print(self.rehil)
        for i in range(self.path_num):
            num = self.rehil[i]
            mean_l1.append(mean_d[num])
            max_l1.append(max_d[num])

        mean_x3 = torch.cat(mean_l1,2)
        max_x3 = torch.cat(max_l1,2)
        mean_b = self.up(mean_x3.view(b,1,self.rh,-1))
        max_b = self.up(max_x3.view(b,1,self.rh,-1))
        b = self.sigmiod(torch.add(mean_b,max_b))
        out = r*b
        return out




